description:
The Bellarine-Corio Bay Local Coastal Hazard Assessment (LCHA) provides information on the extent of coastal hazards and their physical impacts for the Bellarine-Corio Bay coastal environment.

Dynamic inundation modelling was carried out to create this data layer for 1% Annual Exceedance Probability (AEP) coastal inundation under the assumption of 1.4 m Sea Level Rise in 2016 ("High Flow" scenario, for the following study areas along the coast of the Bellarine Peninsula and Greater Geelong area: Barwon Heads / Lake Connewarre; Breamlea; Newcomb; and Queenscliff / Lakers Cutting. 

Details of the assumptions made in the derivation of this information can be found in project reports on the Our Coast website: http://www.ourcoast.org.au/cb_pages/resources.php.
Users of this information should read these project reports to understand the limitations of the data.

Attribute Information: 
Max_d - Maximum depth (m); 
max_s - Maximum velocity (m/s); 
max_vxd - Velocity*Depth Criteria; 
max_wse - Maximuum water surface elevation (mAHD).

This WAMSI project was carried out between March 2008 and March 2010 project and had 5 general objectives:

1. To characterise the western coastal geological and aquifer structure;   

2. To characterise the hydrogeology the western coastal plain and availability of potable water;   

3. To characterise the coastal seawater/freshwater interface, and its behaviour in relation to seasonal fluctuations, tidal and episodic events (eg. cyclones);

4.  To determine the physico-chemical structure of the freshwater/saltwater system;

5.  To determine the pathways of groundwater discharge to the Ningaloo Reef lagoon, and physical and/or benthic ‘signals’ of discharge, by remote sensing and ground truth studies.
